涯的期望。</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　话不多说，直接上数据：</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　金融不必多说了，放在任何一个国家都是高收入人群的代表专业，经济发展是每个国家地区的命脉，因此任何地方都少不了操控和管理经济的人才。头脑聪明的金融人向来都是站在金字塔尖的高智商复合型人才，不止是收入的代表，更是精英的代表。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　至于会计和财务管理，那也是引得众多其他专业学生纷纷想要分一杯羹的行业。据高顿ACCA研究院的调查数据显示，10个学习ACCA的学员中至少有5个是非财会相关专业，而他们未来的目标却都是想做财会方面的工作。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　归根究底，财会行业的门槛并不高，晋升空间比较大，未来的职业发展也更多依赖自身的工作经验和专业能力，是个比较稳定且踏实的行业。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　<strong style=\"margin: 0px; padding: 0px;\">其次，符合社会潮流的变化。</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　中国经济实力不断壮大，成为世界上第二大经济体之后，仍然以惊人的速度不断发展着，在这种历史背景下，前所未有的经济和金融机遇充斥当前，谁可以摸清这时的经济和市场规律，谁能在经济变化中做到顺风而行，逆风而止，谁无疑就是赢家。&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　举个例子，当你发现英国脱欧使得英镑贬值的时候，你除了想到ACCA的报名费又便宜了之外，是否有考虑到国际黄金价格的波动，公司产品的市场价格是否受到影响，这一系列连锁反应背后的原因又是什么。这些，会计师和金融人会思考，并得出分析及答案。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　但机器不能。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　最近人工智能未来将横扫财务金融圈的预言甚嚣尘上，但我们应该明白一点，从事基层流水工作的普通员工才是最容易被替代的一批人，能够为企业乃至国家带来利益的会计师和金融师却不会被如此轻易取代。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　<strong style=\"margin: 0px; padding: 0px;\">最后，可以应用于生活，受益终生。</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　现在很多家庭生活都比较宽裕，手里会有一些可支配收入，免不了要进行投资，在这个时代只知道把钱存在银行的人是赚不了大钱的。手里有钱的父母们想做一些理财，自己不太懂，交给别人又不放心，孩子学习这些专业就派上了一定的用场，要是以后从事相关工作，也不必再去找别人，省心省力。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　总之，跟钱打交道的工作总是一件充满刺激的有趣事，收入高，地位高，专业能力强，这些听起来牛逼哄哄的理由不就够了嘛</span></p>', '1', '2018-03-07 14:58:48', '1', '2018-03-07 14:58:48', '', '0');
INSERT INTO `znew` VALUES ('3', '测施工员必会的计算法，工程计量别再拍脑袋估算了计量别再拍脑袋估算了', '首先，它是编制施工图预算的重要因素，工程量计算是否准确，直接关系到工程\r\n			造价的准确性。其次，工程量是施工企业编制施工作业计划、合理地安排其次，工程量是施工企业编制施工作业计划、合理地安排其次，工程量是施工企业编制施工作业计划、合理地安排其次，工程量是施工企业编制施工作业计划、合理地安排', '/jianzhi/userfiles/1/images/about/news/2018/03/X131502617176711.jpg', '1', '0', '0', '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">有人说，会计是金融的基础，金融是会计的灵魂。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　言下之意，两者相辅相成，你中有我，我中有你。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　事实上，两者在高校的受欢迎程度也是不想上下，常年稳居“大学最受欢迎专业”、“十大高校热门专业”等等莫名其妙的榜单的TOP10。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　即便是出国留学，选择商科的中国学生也是多如牛毛，当然，所谓商科，其中的主力军自然就是会计、金融、经济、财务管理这些专业啦。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　<strong style=\"margin: 0px; padding: 0px;\">那么问题来了，到底为什么这三个专业如此深受学生和家长的青睐呢？</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　<strong style=\"margin: 0px; padding: 0px;\">首先，最重要的一点，就业前景好，完全符合了家长和学生对以后职业生涯的期望。</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　话不多说，直接上数据：</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　金融不必多说了，放在任何一个国家都是高收入人群的代表专业，经济发展是每个国家地区的命脉，因此任何地方都少不了操控和管理经济的人才。头脑聪明的金融人向来都是站在金字塔尖的高智商复合型人才，不止是收入的代表，更是精英的代表。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　至于会计和财务管理，那也是引得众多其他专业学生纷纷想要分一杯羹的行业。据高顿ACCA研究院的调查数据显示，10个学习ACCA的学员中至少有5个是非财会相关专业，而他们未来的目标却都是想做财会方面的工作。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　归根究底，财会行业的门槛并不高，晋升空间比较大，未来的职业发展也更多依赖自身的工作经验和专业能力，是个比较稳定且踏实的行业。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　<strong style=\"margin: 0px; padding: 0px;\">其次，符合社会潮流的变化。</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　中国经济实力不断壮大，成为世界上第二大经济体之后，仍然以惊人的速度不断发展着，在这种历史背景下，前所未有的经济和金融机遇充斥当前，谁可以摸清这时的经济和市场规律，谁能在经济变化中做到顺风而行，逆风而止，谁无疑就是赢家。&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　举个例子，当你发现英国脱欧使得英镑贬值的时候，你除了想到ACCA的报名费又便宜了之外，是否有考虑到国际黄金价格的波动，公司产品的市场价格是否受到影响，这一系列连锁反应背后的原因又是什么。这些，会计师和金融人会思考，并得出分析及答案。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　但机器不能。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　最近人工智能未来将横扫财务金融圈的预言甚嚣尘上，但我们应该明白一点，从事基层流水工作的普通员工才是最容易被替代的一批人，能够为企业乃至国家带来利益的会计师和金融师却不会被如此轻易取代。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　<strong style=\"margin: 0px; padding: 0px;\">最后，可以应用于生活，受益终生。</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　现在很多家庭生活都比较宽裕，手里会有一些可支配收入，免不了要进行投资，在这个时代只知道把钱存在银行的人是赚不了大钱的。手里有钱的父母们想做一些理财，自己不太懂，交给别人又不放心，孩子学习这些专业就派上了一定的用场，要是以后从事相关工作，也不必再去找别人，省心省力。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　总之，跟钱打交道的工作总是一件充满刺激的有趣事，收入高，地位高，专业能力强，这些听起来牛逼哄哄的理由不就够了嘛</span></p>', '1', '2018-03-07 14:58:48', '1', '2018-03-07 14:58:48', '', '0');
INSERT INTO `znew` VALUES ('4', '测施工员必会的计算法，工程计量别再拍脑袋估算了计量别再拍脑袋估算了', '首先，它是编制施工图预算的重要因素，工程量计算是否准确，直接关系到工程\r\n			造价的准确性。其次，工程量是施工企业编制施工作业计划、合理地安排其次，工程量是施工企业编制施工作业计划、合理地安排其次，工程量是施工企业编制施工作业计划、合理地安排其次，工程量是施工企业编制施工作业计划、合理地安排', '/jianzhi/userfiles/1/images/about/news/2018/03/X131502617176711.jpg', '1', '0', '0', '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">有人说，会计是金融的基础，金融是会计的灵魂。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　言下之意，两者相辅相成，你中有我，我中有你。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　事实上，两者在高校的受欢迎程度也是不想上下，常年稳居“大学最受欢迎专业”、“十大高校热门专业”等等莫名其妙的榜单的TOP10。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　即便是出国留学，选择商科的中国学生也是多如牛毛，当然，所谓商科，其中的主力军自然就是会计、金融、经济、财务管理这些专业啦。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　<strong style=\"margin: 0px; padding: 0px;\">那么问题来了，到底为什么这三个专业如此深受学生和家长的青睐呢？</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　<strong style=\"margin: 0px; padding: 0px;\">首先，最重要的一点，就业前景好，完全符合了家长和学生对以后职业生涯的期望。</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　话不多说，直接上数据：</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　金融不必多说了，放在任何一个国家都是高收入人群的代表专业，经济发展是每个国家地区的命脉，因此任何地方都少不了操控和管理经济的人才。头脑聪明的金融人向来都是站在金字塔尖的高智商复合型人才，不止是收入的代表，更是精英的代表。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　至于会计和财务管理，那也是引得众多其他专业学生纷纷想要分一杯羹的行业。据高顿ACCA研究院的调查数据显示，10个学习ACCA的学员中至少有5个是非财会相关专业，而他们未来的目标却都是想做财会方面的工作。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　归根究底，财会行业的门槛并不高，晋升空间比较大，未来的职业发展也更多依赖自身的工作经验和专业能力，是个比较稳定且踏实的行业。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　<strong style=\"margin: 0px; padding: 0px;\">其次，符合社会潮流的变化。</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　中国经济实力不断壮大，成为世界上第二大经济体之后，仍然以惊人的速度不断发展着，在这种历史背景下，前所未有的经济和金融机遇充斥当前，谁可以摸清这时的经济和市场规律，谁能在经济变化中做到顺风而行，逆风而止，谁无疑就是赢家。&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　举个例子，当你发现英国脱欧使得英镑贬值的时候，你除了想到ACCA的报名费又便宜了之外，是否有考虑到国际黄金价格的波动，公司产品的市场价格是否受到影响，这一系列连锁反应背后的原因又是什么。这些，会计师和金融人会思考，并得出分析及答案。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　但机器不能。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　最近人工智能未来将横扫财务金融圈的预言甚嚣尘上，但我们应该明白一点，从事基层流水工作的普通员工才是最容易被替代的一批人，能够为企业乃至国家带来利益的会计师和金融师却不会被如此轻易取代。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　<strong style=\"margin: 0px; padding: 0px;\">最后，可以应用于生活，受益终生。</strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　现在很多家庭生活都比较宽裕，手里会有一些可支配收入，免不了要进行投资，在这个时代只知道把钱存在银行的人是赚不了大钱的。手里有钱的父母们想做一些理财，自己不太懂，交给别人又不放心，孩子学习这些专业就派上了一定的用场，要是以后从事相关工作，也不必再去找别人，省心省力。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(51, 51, 51); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 18px;\">　　总之，跟钱打交道的工作总是一件充满刺激的有趣事，收入高，地位高，专业能力强，这些听起来牛逼哄哄的理由不就够了嘛</span></p>', '1', '2018-03-07 14:58:48', '1', '2018-03-07 14:58:48', '', '0');
